        return "The number has a decimal part. No Results"
    n = abs(int(n))

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    highest_prime = -1
    highest_divisor = -1

    for i in range(1, n // 2 + 1):
        if n % i == 0:
            if is_prime(i):
                highest_prime = max(highest_prime, i)
            highest_divisor = max(highest_divisor, i)

    if highest_prime == -1:
        return []

    if highest_divisor == n:
        highest_divisor //= 2

    return [highest_prime, highest_divisor]
