def big_primefac_div(n):
    if isinstance(n, float) and n != int(n):
        return "The number has a decimal part. No Results"
    n = abs(int(n))
    highest_prime = None
    highest_divisor = None

    def prime_factors(x):
        factors = []
        for i in range(2, int(x**0.5) + 1):
            while x % i == 0:
                factors.append(i)
                x //= i
        if x > 1:
            factors.append(x)
        return factors

    factors = prime_factors(n)
    if not factors:
        return []

    highest_prime = max(factors)
    divisors = [i for i in range(1, n) if n % i == 0]
    if divisors:
        highest_divisor = max(divisors)

    return [highest_prime, highest_divisor] if highest_divisor is not None else []
